import React, { Component } from 'react';
import './index.css';

export class NavButton extends Component {
state = {
    border: "2px solid black",
    borderH: "3em",
    borderW: "3em",
    bgColor: "black",
    lineH: "4px",
    lineW: "30px",
}

  render() {
    return (
      <div className="button-border" style={{ border: this.state.border,  height: this.state.borderH, width: this.state.borderW, }}>
         <div  className="button-line-top"style={{ backgroundColor: this.state.bgColor, height: this.state.lineH, width: this.state.lineW }}></div>
         <div  className="button-line-center"style={{ backgroundColor: this.state.bgColor, height: this.state.lineH, width: this.state.lineW }}></div>
         <div  className="button-line-bottum"style={{ backgroundColor: this.state.bgColor, height: this.state.lineH, width: this.state.lineW }}></div>
      </div>
    )
  }
}

export default NavButton;
